import React from 'react';
import {Link} from 'react-router-dom';
class CreateProjectButton extends React.Component{
    render(){
        return (
            <React.Fragment>
                    <Link to="/addProject" className="btn btn-lg btn-info" >
                    Create a Project
                    </Link>&nbsp;
                    <Link to="/addProject" className="btn btn-lg btn-info" >
                    Home
                    </Link>  
            </React.Fragment>                   

        );
    }
}

export default CreateProjectButton;
